        props.Size(size)
    )

    return(
        <div>
            <Slider size = {setSize}>Size</Slider>
            <Button bttnFun = {() => setTask("Line")}>Line</Button>
            <Button bttnFun = {() => setTask("QuardLine")}>QuardLine</Button>
        </div>
        );
    };

export default Line;
